import React from 'react';
import './App.css';

const albums = [
    {
        id : 1,
        name : 'Future Nostalgia',
        artist : 'Dua Lipa'
    },
    {
        id : 2,
        name : 'From Midnight To Sunrise',
        artist : 'Crush'
    },
    {
        id : 3,
        name : 'Miss Anthropocene',
        artist : 'Grimes'
    }
]

class Album extends React.Component {
    render() {
        return (
            <div>
                <h2>
                    {this.props.id}번째 Album : {this.props.name}
                </h2>
                <h3>
                    Artist : {this.props.artist}
                </h3>
            </div>
        );
    }
}

class App extends React.Component {
    render() {
        return (
            <div>
                <center>
                    <h1>
                        대중 음악의 이해
                    </h1>
                    <h2>
                        정기 음평회
                    </h2>
                </center>

                {albums.map( album => {
                    return <Album 
                        key = {album.id}
                        id = {album.id}
                        name = {album.name}
                        artist = {album.artist}
                    />
                })}
            </div>
        );
    }
}

export default App;
